INSERT INTO Recette (recette_id, nom, desc_long, desc_court, temps_prep_min, temps_cuisson_min, nb_portions, image_content, image_content_type)
VALUES
	('pate_chinois', 'Pâté chinois', 'Le pâté chinois est un plat traditionnel de la cuisine québécoise. Bien que son nom puisse prêter à confusion, il n''a en réalité rien à voir avec la cuisine chinoise. Le pâté chinois est composé de trois couches principales : du bœuf haché revenu à la poêle, des maïs en grains et de la purée de pommes de terre. Ces trois éléments sont superposés dans un plat allant au four, avec la purée de pommes de terre recouvrant le mélange de bœuf et de maïs. Le plat est ensuite cuit au four jusqu''à ce que la purée de pommes de terre soit dorée.', 'Le pâté chinois est un plat traditionnel de la cuisine québécoise.', 20, 60, 4, '\', 'image/jpeg'),
	('lasagnes', 'Lasagnes à la bolognaise', 'Les lasagnes à la bolognaise sont un plat classique de la cuisine italienne. Elles sont composées de couches de pâtes, de viande de bœuf hachée assaisonnée avec une sauce tomate et d''une béchamel onctueuse. Les lasagnes sont ensuite gratinées au four pour obtenir une texture dorée et croustillante. C''est un plat réconfortant et délicieux, idéal pour les dîners en famille.','Les lasagnes à la bolognaise sont un plat classique de la cuisine italienne.', 30, 45, 6, '\', 'image/jpeg'),
	('tiramisu', 'Tiramisu', 'Le tiramisu est un dessert italien classique et irrésistible. Il est préparé en superposant des couches de biscuits imbibés de café fort et de crème mascarpone sucrée. Le dessert est souvent saupoudré de cacao en poudre pour ajouter une touche de saveur et de décoration. Le tiramisu est un dessert crémeux, moelleux et plein de saveurs de café, parfait pour les amateurs de sucreries.','Le tiramisu est un dessert italien classique et irrésistible.', 15, 0, 8, '\', 'image/jpeg'),
	('poulet_curry', 'Poulet au curry', 'Le poulet au curry est un plat populaire de la cuisine indienne. Il se compose de morceaux de poulet tendres cuits dans une sauce épicée au curry, à base de tomates, d''oignons, d''ail, de gingembre et d''un mélange d''épices aromatiques. Le plat est servi avec du riz basmati parfumé et peut être accompagné de naans ou de chapatis. Le poulet au curry est savoureux et plein de saveurs exotiques.','Le poulet au curry est un plat populaire de la cuisine indienne.', 20, 40, 4, '\', 'image/jpeg'),
	('pizza_hawaienne', 'Pizza hawaïenne', 'La pizza hawaïenne, contrairement à ce que son nom indique, n''est pas originaire de l''archipel volcanique du Pacifique mais plutôt de l''Ontario. En 1962, Sam Panopoulos a eu l''idée de prendre le jambon aux ananas que cuisinait sa grand-mère et de mettre cela sur une pizza, créant cette abomination ainsi qu''une crise diplômatique entre l''Italie et le Canada.','La pizza hawaïenne, contrairement à ce que son nom indique, n''est pas originaire de l''archipel volcanique du Pacifique mais plutôt de l''Ontario.', 20, 15, 4, '\', 'image/jpeg')
