INSERT INTO Etape (recette_id, ordre, description)
VALUES
	('pate_chinois', 1, 'Couper les pommes de terre en dés et les mettre dans une casserole. Couvrir d''eau froide et saler. Porter à ébullition et laisser mijoter 25 minutes. Égoutter et remettre dans la casserole.'),
	('pate_chinois', 2, 'À l''aide d''un pilon, Écraser les pommes de terre avec 30 mL de beurre. Ajouter le lait et réduire le mélange en purée avec un batteur électrique. Saler et poivrer. Réserver.'),
	('pate_chinois', 3, 'Placer la grille au centre du four, préchauffer à 190°C (375°F).'),
	('pate_chinois', 4, 'Dans une grande poêle à feu moyen-élevé, dorer l''oignon dans le reste du beurre. Ajouter la viande et cuire en émiettant jusqu''à ce qu''elle soit dorée. Saler et poivrer.'),
	('pate_chinois', 5, 'Presser légèrement la viande dans le fond d''un plat de cuisson. Y étaler le maïs puis la purée de pommes de terre. Saupoudrer de persil.'),
	('pate_chinois', 6, 'Cuire au four 30 minutes. Terminer à cuisson à broil si désiré. Laisser reposer 10 minutes avant de servir.'),
	('lasagnes', 1, 'Préchauffer le four à 180°C (350°F).'),
	('lasagnes', 2, 'Dans une grande poêle, faire revenir l''oignon haché et l''ail émincé. Ajouter la viande de bœuf hachée et cuire jusqu''à ce qu''elle soit dorée. Saler et poivrer.'),
	('lasagnes', 3, 'Ajouter la sauce tomate à la viande et laisser mijoter pendant 10 minutes.'),
	('lasagnes', 4, 'Dans un plat allant au four, alterner des couches de feuilles de lasagne, de viande à la sauce tomate et de sauce béchamel. Répéter l''opération jusqu''à épuisement des ingrédients.'),
	('lasagnes', 5, 'Saupoudrer de parmesan râpé sur le dessus des lasagnes.'),
	('lasagnes', 6, 'Cuire au four pendant 30 minutes ou jusqu''à ce que le fromage soit fondu et doré.'),
	('poulet_curry', 1, 'Couper les filets de poulet en morceaux et les faire revenir dans une poêle avec de l''huile jusqu''à ce qu''ils soient dorés. Réserver.'),
	('poulet_curry', 2, 'Dans la même poêle, faire revenir les oignons et l''ail jusqu''à ce qu''ils soient translucides.'),
	('poulet_curry', 3, 'Ajouter les tomates concassées, le lait de coco et la pâte de curry. Laisser mijoter pendant 15 minutes.'),
	('poulet_curry', 4, 'Remettre les morceaux de poulet dans la poêle et laisser cuire pendant 10 minutes.'),
	('tiramisu', 1, 'Dans un bol, mélanger le mascarpone, les jaunes d''œufs et le sucre jusqu''à obtenir une crème lisse.'),
	('tiramisu', 2, 'Monter les blancs d''œufs en neige ferme et les incorporer délicatement à la crème au mascarpone.'),
	('tiramisu', 3, 'Tremper les biscuits à la cuillère dans le café fort et les disposer dans un plat.'),
	('tiramisu', 4, 'Recouvrir les biscuits avec une couche de crème au mascarpone.'),
	('tiramisu', 5, 'Répéter l''opération jusqu''à épuisement des ingrédients, en terminant par une couche de crème au mascarpone.'),
	('tiramisu', 6, 'Saupoudrer généreusement de cacao en poudre.'),
	('tiramisu', 7, 'Réfrigérer pendant au moins 4 heures avant de servir.'),
	('pizza_hawaienne', 1, 'Préchauffer le four à 220°C (425°F).'),
	('pizza_hawaienne', 2, 'Étaler la pâte à pizza sur une plaque de cuisson préalablement graissée.'),
	('pizza_hawaienne', 3, 'Répartir les tranches de jambon fumé sur la pâte à pizza.'),
	('pizza_hawaienne', 4, 'Verser la sauce à pizza sur le jambon.'),
	('pizza_hawaienne', 5, 'Parsemer le fromage mozzarella râpé sur la sauce à pizza.'),
	('pizza_hawaienne', 6, 'Disposer les morceaux d''ananas coupés en petits morceaux sur la pizza.'),
	('pizza_hawaienne', 7, 'Cuire au four pendant 15 à 20 minutes ou jusqu''à ce que la pâte soit dorée et le fromage fondu.'),
	('pizza_hawaienne', 8, 'Finalement, enlever les ananas avant de servir parce que ce fruit n''a vraiment pas d''affaire sur une pizza.')
