	('poulet_curry', 'marcarcand@hotmail.com', 'Le poulet au curry était épicé à la perfection, j''ai adoré !', '2023-05-02 09:15:00'),
	('tiramisu', 'josbleau@hotmail.com', 'Le tiramisu était divin, la crème était parfaitement onctueuse.', '2023-06-12 14:55:00'),
